import React from 'react';
import style from './todos.module.css';

const Todos = () => {
  const fetching = () => {};
  return (
    <div className={style.todo}>
      <h1>Get Your Todos</h1>
      <button onClick={fetching}>Fetch</button>
    </div>
  );
};

export default Todos;
